import React from 'react';
import "./App.css";

const Footer = () => {
    return (
        <div className="Footer">
            <img src='DanHintzDesignLogo-DHSmileOutlined.svg' alt="Dan Hintz Logo" height="100%" />
            <p>This is the Footer</p>
        </div>
    )
}

export default Footer;
